import { Link } from "react-router-dom";
const Dummy_EVENTS=[
{
    id:'e1',
    title:'Some event',
},
{
    id:'e2',
    title:'Another event'
}
]
function EventsPage(){
    return <>
      
      <h1>Events Page</h1>
      <ul>
        {Dummy_EVENTS.map(event=><li key={event.id}>
            <Link to=""></Link>
        </li>)}
      </ul>
    </>
  
}
export default EventsPage;
